import React, { useState } from "react";
import "./styles/nav.css";

const Nav = () => {
  return (
    <div className="navbar">
      <a href="#home">Home</a>
      <a href="#news">News</a>
      <a href="#contact">Contact</a>
    </div>
  );
};

export default Nav;
